import { Formik } from "formik";
import React from "react";

export default function Form({
  children,
  initialValues,
  onSubmit,
  validationSchema,
}) {
  return (
    <Formik
      initialValues={initialValues}
      validationSchema={validationSchema}
      onSubmit={onSubmit}
    >
      {() => <React.Fragment>{children}</React.Fragment>}
    </Formik>
  );
}
